
var mssql = require('mssql');

var html;
function restarting (req, res, next) {
	if (global.socialedu_settings.databaseType === 'sqlserver' && 
        (mssql.globalConnection === undefined || mssql.globalConnection.connected !== true)
        ) {
		res.send(html);
	} else {
        return next();
    }
    
}

html = '<!DOCTYPE HTML><html><head><title>server restarting</title><script type="text/javascript">setTimeout(function () {window.location.href=\'/\';}, 5000);</script></head><body style="position: relative; width: 100%; height: 100% padding: 0; margin: 0;"><div style="width: 100%; box-sizing: border-box;"><div style="margin-left: auto; margin-right: auto; margin-top: 30px; width: 360px; height: 150px; background-size: 100%; background-image: url(\'data:image/gif;base64,\');">The server is restarting</div></div></body></html>';

module.exports = restarting;